from skew import skew
from utils.pyutils import fst, snd


def minimum_skew(text):
    skew_list = skew(text)
    minimum_pair = min(enumerate(skew_list), key=snd)
    return map(fst, filter(lambda x: snd(x) == snd(minimum_pair), enumerate(skew_list)))


if __name__ == '__main__':
    TEXT = ''
    print(' '.join(map(str, minimum_skew(TEXT))))